import React from 'react';
// import Info from './Info';

export default function Person(props) {
    return (
        <div>
            <h3>{props.name}</h3>
            <p>{props.age}</p>
            <p>{props.city}</p>
            <p>{props.hoobies}</p>


            {/* <Info info={props.age}/>
            <Info info={props.city}/>
            <Info info={props.hoobies}/> */}
        </div>
    )
}
